-- View queries START
CREATE OR REPLACE VIEW reservation_view AS
SELECT reservation.nas_client, start_date, end_date, room_number, first_name, last_name, age, checked_in
FROM reservation
JOIN client
ON reservation.nas_client = client.nas_client;

CREATE OR REPLACE VIEW location_view AS
SELECT location.nas_client, start_date, end_date, room_number, first_name, last_name, age, checked_out
FROM location
JOIN client
ON location.nas_client = client.nas_client;
-- View queries END

